import React, { useEffect } from 'react';
import Navbar from "../components/navbar_unlog";
import Bullehashtag from '../components/bulle-hashtag';
import Miniphoto from "../components/miniphoto-bloc-profil"
import '../styles/pages/_profil.scss';
import { useSelector } from 'react-redux';

// fonction utils a deplacer

// function capitalizeFirstLetter(str) {
//     return str.charAt(0).toUpperCase() + str.slice(1);
// }

// function calculerAge(dob) {
//     const diff = Date.now() - dob.getTime();
//     const age = new Date(diff);
//     return Math.abs(age.getUTCFullYear() - 1970);
// }

//

const Profil = () => {

    const [isLoading, setIsLoading] = useState(true);
    const userData = useSelector((state) => state.userReducer)

    useEffect(() => {
        if (userData) {
            setIsLoading(false);
        }
    }, [userData]);

    if (isLoading) {
        return <div>Chargement</div>;
    }



    return (
        <div>
            <div className="first-profil-container">
            <Navbar />
            <h1>{userData[0].name} {userData[0].firstname}, {userData[0].dob}</h1>
            <div className="top-profil-container">
                <div className="profil-picture">

                </div>
                <div className="profil-description">Quod cum ita sit, paucae domus studiorum seriis cultibus antea celebratae nunc ludibriis ignaviae torpentis exundant, vocali sonu, perflabili tinnitu fidium resultantes. denique pro philosopho cantor et in locum oratoris doctor artium ludicrarum accitur et bybliothecis sepulcrorum ritu in perpetuum clausis organa fabricantur hydraulica, et lyrae ad speciem carpentorum ingentes tibiaeque et histrionici gestus instrumenta non levia.</div>
            </div>
            </div>
            <div className="second-profil-container">
                <div className="hashtah-profil-container">
                    <div className="logo-profil-hashtag"><img src="../img/hashtag-logo.svg" height="72px"/></div>
                    <div className="bulle-hashtag-container">
                        <Bullehashtag />
                        <Bullehashtag />
                        <Bullehashtag />
                        <Bullehashtag />
                        <Bullehashtag />
                        <Bullehashtag />
                        <Bullehashtag />
                        <Bullehashtag />
                    </div>
                </div>
            <div className="third-profil-container">
                <div className="description-profil-list">
                    <li className="description-profil-li">
                        <ul>Nom</ul>
                        <ul>Prenom</ul>
                        <ul>Age</ul>
                        <ul>genre</ul>
                        <ul>orientation</ul>
                        <ul>origine/yeux/taille (ect.)</ul>
                    </li>
                </div>
                <div className="container-profil-4photo">
                    <div className="bloc1-photo4">
                        <Miniphoto />
                        <Miniphoto />
                    </div>
                    <div className="bloc2-photo4">
                    <Miniphoto />
                    <Miniphoto />
                    </div>
                </div>
            </div>
            </div>
        </div>
    );
};

export default Profil;
